import './App.scss';
import React, {Component} from 'react';
import {BrowserRouter, Route, Switch, withRouter} from "react-router-dom"
import Header from "./components/Header/Header";
import VideoList from "./components/VideoList/VideoList";
import Upload from "../src/components/Upload/Upload";


//Using proper React best practices, I have made my App.js clean. It is used for routing only. My logic has been placed in the component files.
class App extends Component{

  render(){

  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Switch>

          <Route exact path="/upload" component={Upload}/>

          <Route exact path="/video/:videoId" component={VideoList}/>

          <Route exact path="/" component={withRouter (VideoList)}/>  

        </Switch>
      </BrowserRouter>
    </div>
  )}
}

export default App;
